import logo from './logo.svg';
import './App.css';
import { Progress } from '@chakra-ui/react'

function App() {
    return (
        <div className="App">
            <div class="progress">
                <Progress hasStripe value={80}></Progress>
                <Heading>Test</Heading>
            </div>
            <div class="progressCircle"></div>
            <div class="employees"></div>
        </div>
    );
}

export default App;
